import React, { Component } from 'react';
import Grid from '@material-ui/core'

class Highlights extends Component {
    render() {
        return (
            <grid item container direction="row">
                <Grid item xs={4}>
                    <h1>Home</h1>
                </Grid>

                <h1>
                    Projects
                </h1>

                <h1>
                    About Me
                </h1>
            </grid>


        )
    }
}

export default Menu;
